import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        posts: []
     }

     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/posts')
         .then(response => {
             console.log(response)
             this.setState({
                 posts: response.data
             })
         })
         .catch(error => {
             console.log(error)
         })
     }

    render() { 

        let { posts } = this.state
        return ( 
            <div>
                {
                   posts.map(post => {
                       return(
                           <div key="1">
                               <p>{post.body}</p>
                           </div>
                       );
                   }) 
                }
            </div>
         );
    }
}

export default Main;
